import React from 'react';
import Accueil from './Accueil';
import { Switch } from 'react-router-dom';

function LoginForm() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={Accueil} />
      </Switch>
    </Router>
  );
}

export default LoginForm;
